    return (
        <div>
        {users?.map(u => 
            <span key={u.id}>
              <select className="select-users">
                    <option selected value="default">Usuarios</option>
                    <option value="opt-1">{users.username ? users.username : '' }</option>
                    <option value="opt-2">Selection 2</option>
                </select>
            </span>)} 

                </div>
    )
 }

 export default GetUsers
